import logo from './images/uno_O.png';
import './App.css';

/* Me playing around with a react elemnt */
/* This element uses JSX as page formatting (But how is it different than HTML doe?) */
function AboutPage() {
    return (
    <>
        <h1>About me!</h1>
        <p>
            My name is Seth and I have no React experience lol<br/>
            Let me insert this custom React element here to play around with shit.<br/>
            I'm declared in <code>src/App.js</code> and called as an element in <code><App/></code>
        </p>
    </>
    )
}

export function HeaderToo() {
    return (
    <>
        <h2>I'm also a header!</h2>
        <p>
            I'm a React element declared in <code>src/App.js</code>. I was declared to be exportable, and thus can be imported imported into <code>src/index.js</code> to be rendered directly there.
        </p>
    </>
    )
}

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />

        <h1>Welcome to JumpStart!</h1>

        <p>
            It does nothing right now. Enjoy this spinning icon because all I did was modify the default JS script provided by Facebook when building a new React environment.
        </p>

        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
            <button className="button">Learn React</button> 
        </a>
        <a
          className="App-link"
          href="https://www.w3schools.com/REACT/react_getstarted.asp"
          target="_blank"
          rel="noopener noreferrer"
        >
            <button className="button">W3 schools equivelant</button> 
        </a>
      </header>
    <AboutPage/>
    </div>
  );
}

export default App;
